import React, { useState } from 'react';
import {
  Button,
  Card,
  TextField
} from '@material-ui/core';

function AddItemForm() {
  const [barcode, setBarcode] = useState('');
  const [item, setItem] = useState('');

  return (
    <Card>
      <h3>Add new Item</h3>
      <p>{item}</p>
      <Button onClick={() => setItem('A')}>Add</Button>
      <TextField label="Barcode" variant="outlined" value={barcode} onChange={(event) => setBarcode(event.target.value)} />
    </Card>
  );
}

export default AddItemForm;
